// src/pages/EditPostPage.jsx
import React, { useEffect, useState } from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import axios from 'axios';


export default function EditPostPage() {
  const { id } = useParams();
  const navigate = useNavigate();

  const [form, setForm] = useState({
    title: '',
    description: ''
  });
  const [existingPhotos, setExistingPhotos] = useState([]);
  const [newPhotos, setNewPhotos] = useState([]);
  const [newVideo, setNewVideo] = useState(null);

  useEffect(() => {
    // load post data
    axios.get(`http://localhost:8000/api/posts/${id}`)
      .then(res => {
        setForm({
          title: res.data.title,
          description: res.data.description
        });
        setExistingPhotos(res.data.photoPaths || []);
      })
      .catch(console.error);
  }, [id]);

  const handleChange = e => {
    const { name, value } = e.target;
    setForm(f => ({ ...f, [name]: value }));
  };

  const handleFileChange = e => {
    const files = Array.from(e.target.files);
    setNewPhotos(files);
  };

  const handleVideoChange = e => {
    setNewVideo(e.target.files[0]);
  };

  const handleSubmit = e => {
    e.preventDefault();
    const data = new FormData();
    data.append('title', form.title);
    data.append('description', form.description);

    newPhotos.forEach(photo => data.append('photos', photo));
    if (newVideo) data.append('video', newVideo);

    axios.put(`http://localhost:8000/api/posts/${id}`, data, {
      headers: { 'Content-Type': 'multipart/form-data' }
    })
      .then(() => {
        alert('Post updated!');
        navigate('/');
      })
      .catch(err => {
        console.error(err);
        alert('Update failed');
      });
  };

  return (
    <div className="container py-5">
      <h2>Edit Post</h2>
      <form onSubmit={handleSubmit} className="mt-4">
        <div className="mb-3">
          <label className="form-label">Title</label>
          <input
            name="title"
            value={form.title}
            onChange={handleChange}
            required
            className="form-control"
          />
        </div>
        <div className="mb-3">
          <label className="form-label">Description</label>
          <textarea
            name="description"
            value={form.description}
            onChange={handleChange}
            rows="3"
            required
            className="form-control"
          />
        </div>

        <div className="mb-3">
          <label className="form-label">Replace Photos</label>
          <input
            type="file"
            accept="image/*"
            multiple
            onChange={handleFileChange}
            className="form-control"
          />
          {existingPhotos.length > 0 && (
            <div className="mt-2 existing-media">
              <p>Current Photos:</p>
              <div className="d-flex gap-2">
                {existingPhotos.map((url, idx) => (
                  <img
                    key={idx}
                    src={`http://localhost:8000${url}`}
                    alt="existing"
                    className="preview-img"
                  />
                ))}
              </div>
            </div>
          )}
        </div>

        <div className="mb-4">
          <label className="form-label">Replace Video</label>
          <input
            type="file"
            accept="video/*"
            onChange={handleVideoChange}
            className="form-control"
          />
        </div>

        <button type="submit" className="btn btn-success">
          Save Changes
        </button>
      </form>
    </div>
  );
}
